window.bookSummaryJSON = "<p><b>The epic conclusion of Micheal's journey through First Layer.</b></p> <p>Stopping disasters before they happen, battling against enemies on all sides, saving the lives of millions. The burdens Micheal must bear grow ever heavier as he fights against all odds to complete his mission: stop the apocalypse and save the human race from ultimate destruction.</p> <p>Come and listen to his journey as he gains new powers, greets new allies, and makes startling new discoveries, changing the history of humanity before it has even taken place.</p>"; 
